// /client/src/pages/Admin.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Admin.css';

const Admin = () => {
    const [users, setUsers] = useState([]);
    const [newUser, setNewUser] = useState({ username: '', referralCode: '', donationsRaised: 0 });

    useEffect(() => {
        fetchUsers();
    }, []);

    const fetchUsers = async () => {
        try {
            const response = await axios.get('http://localhost:5000/api/users');
            setUsers(response.data);
        } catch (error) {
            console.error('Error fetching users:', error);
        }
    };

    const handleAddUser = async (e) => {
        e.preventDefault();
        try {
            await axios.post('http://localhost:5000/api/users', newUser);
            setNewUser({ username: '', referralCode: '', donationsRaised: 0 });
            fetchUsers();
        } catch (error) {
            console.error('Error adding user:', error);
        }
    };

    const handleDeleteUser = async (id) => {
        try {
            await axios.delete(`http://localhost:5000/api/users/${id}`);
            fetchUsers();
        } catch (error) {
            console.error('Error deleting user:', error);
        }
    };

    const handleUpdateDonations = async (id, currentDonations) => {
        const newDonations = prompt("Enter new donation amount:", currentDonations);
        if (newDonations !== null && !isNaN(newDonations)) {
            try {
                await axios.put(`http://localhost:5000/api/users/${id}`, { donationsRaised: parseInt(newDonations) });
                fetchUsers();
            } catch (error) {
                console.error('Error updating donations:', error);
            }
        }
    };

    return (
        <div className="page-container admin-page">
            <header className="page-header">
                <h2>Admin Panel</h2>
                <p>Manage intern data here.</p>
            </header>

            <div className="admin-content">
                <div className="add-user-form">
                    <h3>Add New Intern</h3>
                    <form onSubmit={handleAddUser}>
                        <input type="text" placeholder="Username" value={newUser.username} onChange={(e) => setNewUser({...newUser, username: e.target.value})} required />
                        <input type="text" placeholder="Referral Code" value={newUser.referralCode} onChange={(e) => setNewUser({...newUser, referralCode: e.target.value})} required />
                        <button type="submit">Add Intern</button>
                    </form>
                </div>

                <div className="user-list">
                    <h3>All Interns</h3>
                    <table>
                        <thead>
                            <tr>
                                <th>ID</th>
                                <th>Username</th>
                                <th>Referral Code</th>
                                <th>Donations</th>
                                <th>Actions</th>
                            </tr>
                        </thead>
                        <tbody>
                            {users.map(user => (
                                <tr key={user.id}>
                                    <td>{user.id}</td>
                                    <td>{user.username}</td>
                                    <td>{user.referralCode}</td>
                                    <td>â‚¹{user.donationsRaised.toLocaleString()}</td>
                                    <td>
                                        <button onClick={() => handleUpdateDonations(user.id, user.donationsRaised)}>Edit Donations</button>
                                        <button onClick={() => handleDeleteUser(user.id)} className="delete-btn">Delete</button>
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    );
};

export default Admin;
